(5, 70, 'Finding letter to client', 'find-lett-clie', '<p><span style=\"font-size: 10pt;\">Dear</span><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"> <strong>{ia_finding___ia_find_r1_mailto}</strong>,</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Our automated continuous audit system generated the following audit finding.</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">You are listed as the <span style=\"text-decoration: underline;\">responsible person</span> to comment and/or take action based on this finding. Please investigate and reply / update our system with your remarks and / or actions taken, by following links below. Your remarks would update our audit database, and your remarks would be included in our final audit rerport issued to all stakeholders.</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">First <a title=\"NWU Internal Audit\" href=\"http://ia-nwu.co.za/\" target=\"_blank\" rel=\"author noopener noreferrer\">login</a> to our web, then:</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Follow this link {ia_finding___ia_find_edit} to record your response in our audit database.</span></p>\r\n<hr />\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"><strong>Audit assignment:</strong></span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">{ia_finding___ia_assi_auto}</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"><strong>Finding:</strong></span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">{ia_finding___ia_find_name}</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">{ia_finding___ia_find_desc}</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"><strong>Recommendation:</strong></span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">{ia_finding___ia_find_recommend}</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"><strong>More information:</strong></span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">{ia_finding___ia_find_disp}</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">{ia_finding___ia_find_detl}</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">{ia_finding___ia_find_list}</span></p>\r\n<hr />\r\n<p><span style=\"text-decoration: underline; font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"><strong>We would appreciate feedback at your earliest convenience.</strong></span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Many thanks.</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Albert</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"> </span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"><strong>Notes:</strong></span></p>\r\n<p><span class=\"ILfuVd NA6bn\" style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">All <b>audit</b> clients are required to provide a written <b>response</b> to <b>audit</b> findings. The <b>response</b> represents management\'s plan for correcting or improving the finding situation. All <b>responses</b> are included in the final <b>audit</b> report that is distributed to senior management, the Board, and the external auditors.</span></p>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"><strong>Writing an audit finding response can be relatively easy if the following guidelines are used:</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Respond directly to the finding and its recommendation(s)</span></li>\r\n<li><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Provide specific actions that management commits to take to correct the finding</span></li>\r\n<li><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Make your response clear and concise.</span></li>\r\n<li><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Exclude information that is not pertinent to the finding or its corrective action plan</span></li>\r\n<li><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Identify specific positions, if applicable, responsible for implementation</span></li>\r\n<li><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\">Provide a specific and realistic timetable for implementation</span></li>\r\n</ul>\r\n<p><span style=\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\"> </span></p>', '', 1, 8, '2018-11-05 14:12:52', 842, '', '2018-11-29 12:05:09', 842, 0, '0000-00-00 00:00:00', '2018-11-05 14:12:52', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 33, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', 'Automated email finding letter with invite to comment'),
