(26, 'Finding Responses', '<p><span class=\"ILfuVd NA6bn\">All <b>audit</b> clients are required to provide a written <b>response</b> to <b>audit</b> findings. The <b>response</b> represents management\'s plan for correcting or improving the finding situation. All <b>responses</b> are included in the final <b>audit</b> report that is distributed to senior management, the Board, and the external auditors.</span></p>', 24, 'ia_finding_response', 'ia_finding_response.ia_findresp_auto', 1, 2, '2018-11-18 22:00:00', 854, 'Python', '2018-11-20 02:54:28', 842, 0, '0000-00-00 00:00:00', 1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 9, 61, 10, 'bootstrap', '[\"771\"]', '[\"ASC\"]', 'onchange', '', 0, '{\"show-table-filters\":\"1\",\"advanced-filter\":\"0\",\"advanced-filter-default-statement\":\"=\",\"search-mode\":\"1\",\"search-mode-advanced\":\"0\",\"search-mode-advanced-default\":\"all\",\"search_elements\":\"\",\"list_search_elements\":\"{\\\"search_elements\\\":[\\\"771\\\",\\\"772\\\"]}\",\"search-all-label\":\"All\",\"require-filter\":\"0\",\"filter-dropdown-method\":\"0\",\"toggle_cols\":\"0\",\"list_filter_cols\":\"1\",\"empty_data_msg\":\"\",\"outro\":\"<p>Writing an audit finding response can be relatively easy if the following guidelines are used:<\\/p>\\r\\n<ul>\\r\\n<li>Respond directly to the finding and its recommendation(s)<\\/li>\\r\\n<li>Provide specific actions that management commits to take to correct the finding<\\/li>\\r\\n<li>Make your response clear and concise.<\\/li>\\r\\n<li>Exclude information that is not pertinent to the finding or its corrective action plan<\\/li>\\r\\n<li>Identify specific positions, if applicable, responsible for implementation<\\/li>\\r\\n<li>Provide a specific and realistic timetable for implementation<\\/li>\\r\\n<\\/ul>\",\"list_ajax\":\"0\",\"show-table-add\":\"1\",\"show-table-nav\":\"1\",\"show_displaynum\":\"1\",\"showall-records\":\"1\",\"show-total\":\"1\",\"sef-slug\":\"\",\"show-table-picker\":\"1\",\"admin_t