INSERT INTO `ianwu_finding_control` (`ia_findcont_auto`, `ia_findcont_name`, `ia_findcont_desc`, `ia_findcont_value`, `ia_findcont_active`, `ia_findcont_from`, `ia_findcont_to`, `ia_findcont_createdate`, `ia_findcont_createby`, `ia_findcont_editdate`, `ia_findcont_editby`) VALUES
(1, 'Highly effective', 'The control measure effectively addresses the risk. The design of the control measure is excellent, well documented and is fully being applied and being complied with.', 0.10, '1', '2020-08-06 00:00:00', '2099-12-31 00:00:00', '2020-08-06 00:00:00', 854, '0000-00-00 00:00:00', 0),
(2, 'Good', 'An adequate and acceptable level of control exists. The control measure is adequately designed and is effectively being applied & being complied with. Minimal improvements are required.', 0.25, '1', '2020-08-06 00:00:00', '2099-12-31 00:00:00', '2020-08-06 00:00:00', 854, '0000-00-00 00:00:00', 0),
(3, 'Satisfactory', 'A satisfactory level of control exists. The control measure largely addresses the risk. There is room for improvement regarding its design and / or the effectiveness of its application, enforcement or compliance.', 0.50, '1', '2020-08-06 00:00:00', '2099-12-31 00:00:00', '2020-08-06 00:00:00', 854, '0000-00-00 00:00:00', 0),
(4, 'Requires improvement', 'The operation of correctly designed control is not effective and / or the operation of incorrectly designed control may be good but is still not effective in managing the risk and requires improvement.', 0.80, '1', '2020-08-06 00:00:00', '2099-12-31 00:00:00', '2020-08-06 00:00:00', 854, '0000-00-00 00:00:00', 0),
(5, 'Inadequite', 'There is no confidence that any degree of control is being achieved due to very limited operational effectiveness.', 0.90, '1', '2020-08-06 00:00:00', '2099-12-31 00:00:00', '2020-08-06 00:00:00', 854, '0000-00-00 00:00:00', 0);
