/p>\\r\\n<p><strong>Writing an audit finding response can be relatively easy if the following guidelines are used:<\\/strong><\\/p>\\r\\n<ul>\\r\\n<li>Respond directly to the finding and its recommendation(s)<\\/li>\\r\\n<li>Provide specific actions that management commits to take to correct the finding<\\/li>\\r\\n<li>Make your response clear and concise.<\\/li>\\r\\n<li>Exclude information that is not pertinent to the finding or its corrective action plan<\\/li>\\r\\n<li>Identify specific positions, if applicable, responsible for implementation<\\/li>\\r\\n<li>Provide a specific and realistic timetable for implementation<\\/li>\\r\\n<\\/ul>\\r\\n<p><span style=\\\"font-family: tahoma, arial, helvetica, sans-serif; font-size: 10pt;\\\">\\u00a0<\\/span><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2018-11-05 14:12:52\",\"created_by\":\"842\",\"created_by_alias\":\"\",\"modified\":\"2018-11-20 03:41:30\",\"modified_by\":\"842\",\"checked_out\":\"842\",\"checked_out_time\":\"2018-11-20 03:39:52\",\"publish_up\":\"2018-11-05 14:12:52\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"